import React from 'react';
import ReactDOM, { createRoot } from "react-dom/client"
import "./style.css"
import one from "./assets/images/one.jpg"
import two from "./assets/images/three.jpg"



const root = ReactDOM.createRoot(document.getElementById("root"))


//Nav Component
function Navbar(){
    return(
        <nav>
            <h1>Perfumy</h1>
            <ul>
            <li>Home | </li>
            <li>Products | </li>
            <li>About | </li>
            <li>Contact | </li>
            </ul>
        </nav>
    )
}

//search 
function Search(){
    return(
        <div className='searchbar'>
            <input type='text' placeholder='Search perfumes..'/>
        </div>
    )
}

//product
function Product(){
    return(
        <div class="products">

            <div class="box">

                        <img src={one}></img>
                        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
            </div>

            <div class="box">
                <img src={two}></img>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
            </div>
            <div class="box">
                <img src="./images/two.jpg" alt="Designs Club"></img>
                <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
            </div>            
        </div>
    )
}

root.render(
    <div>
    <Navbar></Navbar>
    <Search></Search>
    <Product></Product>
    </div>
)
